import React, { useEffect, useRef, useState } from "react";
import { Link } from "react-router-dom";
import "../../styles/EmployeeOwnership.css";

/* SLIDESHOW IMAGES */
import g3 from "../../assets/gallery/images/gallery3.jpg";
import g4 from "../../assets/gallery/images/gallery4.jpg";
import g5 from "../../assets/gallery/images/gallery5.jpg";
import g6 from "../../assets/gallery/images/gallery6.jpg";
import g7 from "../../assets/gallery/images/gallery7.jpg";

const heroImages = [g3, g4, g5];
const mainImages = [g6, g7, g4];

function EmployeeOwnership() {
  const featureRefs = useRef([]);
  const heroRef = useRef(null);
  const mainRef = useRef(null);
  const ctaRef = useRef(null);

  const [heroIndex, setHeroIndex] = useState(0);
  const [mainIndex, setMainIndex] = useState(0);

  /* HERO SLIDESHOW */
  useEffect(() => {
    const timer = setInterval(() => {
      setHeroIndex((prev) => (prev + 1) % heroImages.length);
    }, 4500);
    return () => clearInterval(timer);
  }, []);

  /* MAIN SLIDESHOW */
  useEffect(() => {
    const timer = setInterval(() => {
      setMainIndex((prev) => (prev + 1) % mainImages.length);
    }, 4000);
    return () => clearInterval(timer);
  }, []);

  /* SCROLL ANIMATIONS */
  useEffect(() => {
    const items = [...featureRefs.current, heroRef.current, mainRef.current, ctaRef.current];

    const observer = new IntersectionObserver(
      (entries) => {
        entries.forEach((entry) => {
          if (entry.isIntersecting) entry.target.classList.add("animate-in");
        });
      },
      { threshold: 0.15 }
    );

    items.forEach((el) => el && observer.observe(el));
    return () => items.forEach((el) => el && observer.unobserve(el));
  }, []);

  return (
    <div className="eo-container">

      {/* HERO */}
      <section className="eo-hero fade-slide" ref={heroRef}>
        <div className="eo-hero-images">
          <img src={heroImages[heroIndex]} alt="RGM Team" />
        </div>
        <div className="eo-hero-content">
          <h1>Employee Ownership at RGM Logistics</h1>
          <p>Built Like a Family. Grown Together.</p>
        </div>
      </section>

      {/* INTRO */}
      <section className="eo-intro fade-slide">
        <p>
          At <strong>RGM Logistics</strong>, we believe a company is strongest
          when its people feel truly invested â€” not just in their work,
          but in each other.
        </p>
      </section>

      {/* MAIN SLIDESHOW */}
      <section className="eo-main fade-slide" ref={mainRef}>
        <h2>Ownership in Action</h2>
        <div className="eo-main-slideshow">
          <img src={mainImages[mainIndex]} alt="RGM Culture" />
        </div>
        <p className="eo-main-text">
          When people feel ownership, they bring pride, accountability,
          and passion into everything they do.
        </p>
      </section>

      {/* FEATURES */}
      <section className="eo-sections">
        {[
          ["ðŸ”’ Stability & Job Security", "We grow carefully and sustainably â€” our people grow with us."],
          ["ðŸ¤œðŸ¤› Team-First Culture", "Collaboration always beats competition."],
          ["ðŸ’° Growth Beyond Paychecks", "Career growth, leadership, and long-term success."],
          ["ðŸš€ Long-Term Vision", "We build careers, not short-term jobs."],
          ["ðŸŒŸ Rare Workplace Culture", "Respect, transparency, and loyalty come first."]
        ].map(([title, text], i) => (
          <div className="eo-feature" key={i} ref={(el) => (featureRefs.current[i] = el)}>
            <h3>{title}</h3>
            <p>{text}</p>
          </div>
        ))}
      </section>

      {/* CTA */}
      <section className="eo-cta fade-slide" ref={ctaRef}>
        <h2>The RGM Promise</h2>
        <p>
          You donâ€™t just work here â€” you belong here.
        </p>
        <Link to="/join/apply" className="eo-apply-btn">
          Join the RGM Family
        </Link>
      </section>

    </div>
  );
}

export default EmployeeOwnership;
